css:
.auto-cursor {
  cursor: default;
}
.kite-status {
  display: inline-block;
}
.kite-status .text:empty {
  display: none;
}
.kite-status kite-logo {
  height: 16px;
  width: 16px;
}
.kite-status kite-logo.badge {
  margin: 0px;
  margin-bottom: 3px;
  background: none;
}
.kite-status kite-logo[sync] {
  display: none;
}
.kite-status[is-indexing] kite-logo[sync],
.kite-status[is-syncing] kite-logo[sync] {
  display: inline-block;
}
.kite-status[is-indexing] kite-logo[small],
.kite-status[is-syncing] kite-logo[small] {
  display: none;
}
.kite-status .text {
  margin-left: 5px;
}
.kite-status .text kbd {
  font-family: sans-serif;
  font-size: 1em;
}
.kite-status[status="unknown"],
.kite-status[status="unsupported"] {
  display: none;
}
.kite-status[status="ready"] kite-logo svg path,
.kite-status[status="ready"] kite-logo svg polygon {
  fill: #9da5b4;
}
.kite-status[status="uninstalled"],
.kite-status[status="running"],
.kite-status[status="installed"] {
  color: #ff6347;
}
.kite-status[status="uninstalled"] kite-logo svg path,
.kite-status[status="running"] kite-logo svg path,
.kite-status[status="installed"] kite-logo svg path,
.kite-status[status="uninstalled"] kite-logo svg polygon,
.kite-status[status="running"] kite-logo svg polygon,
.kite-status[status="installed"] kite-logo svg polygon {
  fill: #ff6347;
}
